## Variable: liberica_java_output
#     Liberica REST API output format.
liberica_java_output: json

## Variable: liberica_java_package_type
#     Liberica package type.
liberica_java_package_type: tar.gz

## Variable: liberica_java_version_modifier
#     Liberica JDK feature realese modifier.
liberica_java_version_modifier: latest

## Variable: liberica_java_api_releases_url
#     Liberica REST API URL.
liberica_java_api_releases_url: https://api.bell-sw.com/v1/liberica/releases
